import Logo from '../Logo';
import Navigation from '../Navigation';
import Container from '@material-ui/core/Container';

import style from './styles.scss';

const Header = () => (
  <header>
    <Container maxWidth='lg' className={style.Header}>
      <Logo />
      <Navigation />
    </Container>
  </header>
);

export default Header;
